import React from "react";

const LeftBar = () => {
  const badges =
    "Allow users to leave friends badges for them and have superlatives for outsings";
  return (
    <div className="container">
      <div className="menu">
        <div className="item">Friends</div>
        <div className="item">Outings</div>
        <div className="item">Groups</div>
        <div className="item">Badges</div>
      </div>
    </div>
  );
};

export default LeftBar;
